import Fetch from "./dataFetch"
import {
    GetRequest
} from "./GetRequest"

export const synCode = async (saveHistory, result, history) => {
    await Fetch('/', 'POST', saveHistory, result)
    await GetRequest.getHistory().then(data => {
        const zeroHistory = data[0]
        return zeroHistory

    })
}
